import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';
import { CartProvider, useCart } from './context/CartContext';
import Products from './pages/Products';
import ProductDetail from './pages/ProductDetail';
import Login from './pages/Login';
import Cart from './pages/Cart';

const Navbar = () => {
  const { state, dispatch } = useAuth();
  const { state: cartState, cartTotal } = useCart();

  const handleLogout = () => {
    dispatch({ type: 'LOGOUT' });
  };

  return (
    <header className="bg-gradient-to-r from-gray-900 to-gray-800 text-white p-4 shadow-lg">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-2xl font-bold hover:text-teal-300 transition-colors">
          üíé GemCart
        </Link>
        <nav className="space-x-6 flex items-center">
          <Link to="/products" className="hover:text-teal-300 transition-colors font-medium">
            üõçÔ∏è Shop
          </Link>
          <Link to="/cart" className="relative">
            <span className="bg-gradient-to-r from-teal-600 to-teal-700 px-3 py-2 rounded-full text-sm font-bold hover:from-teal-700 hover:to-teal-800 transition-all cursor-pointer">
              üõçÔ∏è Cart ({cartState.items.length}) - ${cartTotal}
            </span>
            {cartState.items.length > 0 && (
              <span className="absolute -top-2 -right-2 bg-red-500 text-white rounded-full w-5 h-5 flex items-center justify-center text-xs font-bold animate-pulse">
                {cartState.items.length}
              </span>
            )}
          </Link>
          {state.isAuthenticated ? (
            <>
              <span className="text-teal-300">üë§ Hello, {state.user.username}</span>
              {state.user.is_seller && (
                <span className="bg-yellow-600 px-2 py-1 rounded-full text-xs font-bold">
                  üëë SELLER
                </span>
              )}
              <button onClick={handleLogout} className="hover:text-red-300 transition-colors">
                üö™ Logout
              </button>
            </>
          ) : (
            <Link to="/login" className="bg-teal-600 hover:bg-teal-700 px-4 py-2 rounded-lg transition-colors font-medium">
              üîë Login
            </Link>
          )}
        </nav>
      </div>
    </header>
  );
};

const Home = () => (
  <div className="bg-gradient-to-br from-gray-50 to-teal-50 min-h-screen">
    <div className="container mx-auto p-8 text-center">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-6xl font-extrabold mb-6 bg-gradient-to-r from-teal-600 to-blue-600 bg-clip-text text-transparent">
          ‚ú® Welcome to GemCart ‚ú®
        </h1>
        <p className="text-2xl mb-8 text-gray-700">
          üíé Discover Exquisite Jewelry & ‚åö Luxury Watches
        </p>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-12">
          <div className="bg-white p-6 rounded-xl shadow-lg hover:shadow-xl transition-shadow">
            <div className="text-4xl mb-4">üíç</div>
            <h3 className="text-xl font-bold mb-2">Premium Rings</h3>
            <p className="text-gray-600">Engagement & wedding rings crafted to perfection</p>
          </div>
          <div className="bg-white p-6 rounded-xl shadow-lg hover:shadow-xl transition-shadow">
            <div className="text-4xl mb-4">‚åö</div>
            <h3 className="text-xl font-bold mb-2">Luxury Watches</h3>
            <p className="text-gray-600">Swiss-made timepieces for the discerning collector</p>
          </div>
          <div className="bg-white p-6 rounded-xl shadow-lg hover:shadow-xl transition-shadow">
            <div className="text-4xl mb-4">üíé</div>
            <h3 className="text-xl font-bold mb-2">Precious Gems</h3>
            <p className="text-gray-600">Certified gemstones from around the world</p>
          </div>
        </div>
        <Link 
          to="/products" 
          className="bg-gradient-to-r from-teal-600 to-teal-700 text-white px-8 py-4 rounded-xl text-xl font-bold hover:from-teal-700 hover:to-teal-800 transition-all transform hover:scale-105 shadow-lg"
        >
          üõçÔ∏è Shop Luxury Collection
        </Link>
        <div className="mt-12 text-gray-600">
          <p className="text-lg">üéÜ Free Worldwide Shipping ‚Ä¢ üîí Secure Payment ‚Ä¢ ‚ú® Lifetime Warranty</p>
        </div>
      </div>
    </div>
  </div>
);

function App() {
  return (
    <Router>
      <AuthProvider>
        <CartProvider>
          <Navbar />
          <main>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/products" element={<Products />} />
              <Route path="/products/:id" element={<ProductDetail />} />
              <Route path="/cart" element={<Cart />} />
              <Route path="/login" element={<Login />} />
            </Routes>
          </main>
        </CartProvider>
      </AuthProvider>
    </Router>
  );
}

export default App;
